import React from "react";
import Tilt from 'react-parallax-tilt';
import Face from  './Face.png';
import './Logo.css'

const Logo = () => {
        return (
            <div>
                <nav className="ma4 mt0">
                    <Tilt className="Tilt br2 shadow-2" style={{ height: 50, width: 50 }}>
                    <div><img alt="logo" src={Face}/><p className='f3 link dim black pa3 pointer'>Logout</p></div>
                    </Tilt>
                    <p className='f3 link dim black pa3 pointer'>Logout</p>
                </nav>
            </div>
        )
}

export default Logo;
